import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { ref, get, child } from 'firebase/database'; // import firebase instance

function App() {
  const [data, setData] = useState([]);
  // const [key, setKey] = useState('example-key');  // Set default key here
  const [email, setEmail] = useState('jknee-at-bu-dot-edu'); 

  useEffect(() => {
    // Function to fetch data from Firebase
    const fetchData = async () => {
      try {
        const dbRef = ref(database);
        console.log('Fetching data for:', email);
        const snapshot = await get(child(dbRef, `/${email}`));
        if (snapshot.exists()) {
          const firebaseData = snapshot.val();
          console.log('Data fetched from Firebase:', firebaseData);
          const formattedData = Object.keys(firebaseData).map(key => ({
            id: key,
            ...firebaseData[key]
          }));
          setData(formattedData);  // Store the array osf data
        } else {
          console.log('No data available for this path:', `/${email}`);
        }
      } catch (error) {
        console.error('Error fetching data:', error);
      }
    };

    fetchData();
  }, [email]);

  return (
    <div className="App">
      <h1>Data from Firebase for {email}:</h1>
      <pre>{JSON.stringify(data, null, 2)}</pre>
    </div>
  );
}

export default App;
